import React from "react";
import Card from "../Ul/Card";
import styles from "./UsersList.module.css";

export default function UsersList(props) {
  return (
    <Card>
      <ul>
        {props.users.map((user) => (
          <li>
            {user.name} ({user.age} years old)
          </li>
        ))}
      </ul>
    </Card>
  );
}
